import Logo from "../../assets/img.png";
import { themeHeader } from "./style";
const HeaderHome = () => {
  return (
    <themeHeader>
      <img src={Logo} alt="Logo" />
      <ul>
        <li>
          <button>Home</button>
        </li>
        <li>
          <button>Login</button>
        </li>
        <li>
          <button>Cadastrar escola</button>
        </li>
        <li>
          <button>Eventos</button>
        </li>
      </ul>
    </themeHeader>
  );
};

export default HeaderHome;
